import { library } from "@fortawesome/fontawesome-svg-core";
import {
  faHome,
  faUser,
  faCog,
  faSignOutAlt,
  faTimes,
  faPlayCircle,
  //import any other solid icons
} from "@fortawesome/free-solid-svg-icons";

library.add(
  faHome,
  faUser,
  faCog,
  faSignOutAlt,
  faTimes,
  faPlayCircle
);
